                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            if ((copyMask?.GetShouldTranslate((int)Star_FieldIndex.Keywords) ?? true))
            {
                errorMask?.PushIndex((int)Star_FieldIndex.Keywords);
